import React, { useState } from 'react';
import "./index.css"
import Sdata from "./Sdata";
import filterItems from './Navbar';

const Card = (categery) => {


   const [Menudata, SetMenudata] = useState(Sdata);
   // const [MenuList, SetMenuList] = useState(uniqueList);
  

        const Navbar =()=>{
         const filterItems=()=>{
            const UpdatesList=   Sdata.filter((curElem)=>{
               return  curElem.categery===categery;
                 })
                 SetMenudata(UpdatesList);
              }
         return(<>
         {
             <button onClick={filterItems("categery")}>breakfast </button>
         }
         
         </>)
         }
          

   // const uniqueList = [...new Set(Sdata.map((curElem)=>{
   //    return curElem.categery;
   //    })) ]
      
   return (<>

      {Menudata.map((props) => {
         return (<>
            <div className="card">
               <div className="item_img"><img src={props.imgsrc} alt="imsa" width="340px" height="300px" /></div>
               <h2 className=" title">{props.item_name}</h2>
               <div className="categery">{props.categery}</div>
               <div className="discription">{props.discription}</div>
            </div>
         </>
         );
      })}

   </>
   );
}



   
   export default Card ;
